import React from "react";
import './App.css';
import {
  Dropdown,
  DropdownButton,
  Container,
  Row,
  Col,
  Modal,
  Button
} from "react-bootstrap";

class Car extends React.Component {
  constructor(props) {
    super(props);

  }

render(){
  return (
    <div className="App">
      Title: {this.state.title}
      Photo: <img src={this.state.photo} alt="Test"/> 
      Description: {this.state.description}
      Short Short_Description: {this.state.short_description}
    </div>
  );}
}

export default Car;
